var (
	color0 = color.RGBA{231, 255, 214, 255}
	color1 = color.RGBA{136, 192, 112, 255}
	color2 = color.RGBA{52, 104, 86, 255}
	color3 = color.RGBA{8, 24, 32, 255}
)

func TestFIFO(t *testing.T) {
	// display := display.NewTerminal()

	memory := memory.NewDMGMemory()
	interrupts := controllers.NewInterrupts(memory)
	lcd := controllers.NewLCD(memory, interrupts.Request)
	fifo := newFIFO(memory, lcd)

	min, max := image.Point{0, 0}, image.Point{160, 144}
	rectangle := image.Rectangle{min, max}
	palette := color.Palette{color0, color1, color2, color3}
	image := image.NewPaletted(rectangle, palette)

	frame := make([][]uint8, 154)

	memory.Write(controllers.ADDR_LCD_SCX, 0x00)
	memory.Write(controllers.ADDR_LCD_SCY, 0x00)
	memory.Write(controllers.ADDR_LCD_WX, 6)
	memory.Write(controllers.ADDR_LCD_WY, 0)

	for i, v := range vramDump {
		memory.Write(0x8000+uint16(i), v)
	}

	for i := 0; i < 100; i++ {
		memory.Write(controllers.ADDR_LCD_SCX, uint8(i))
		memory.Write(controllers.ADDR_LCD_SCY, uint8(i))

		for y := 0; y < 154; y++ {
			if y < 16 || y >= 128 {
				memory.Write(controllers.ADDR_LCD_CONTROL, (1<<4)|(1<<5)|(1<<6))
			} else {
				memory.Write(controllers.ADDR_LCD_CONTROL, 0)
			}

			fifo.init()

			for len(fifo.scanline) < 160 {
				fifo.update()
			}

			scanline := fifo.scanline
			line := lcd.GetLY()
			frame[line] = scanline

			for x, v := range scanline {
				image.SetColorIndex(x, y, v)
			}

			lcd.IncLY()
		}

		// display.Draw(frame)

		f, err := os.Create("image.png")
		if err != nil {
			panic(err)
		}
		png.Encode(f, image)
		f.Close()

		time.Sleep(200 * time.Millisecond)
	}
}
